import { StyleSheet, StatusBar } from "react-native"

const Styles = StyleSheet.create({
  logo: {
    width: "40%",
    height: 100,
    alignSelf: "center",
    marginTop: 20,
  },
  welcome: {
    fontSize: 20,
    textAlign: "center",
    margin: 10,
    fontWeight: "bold",
  },
  header: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
  },
})

export default Styles
